FeedPackage.Description:
Integration library for OpenLayers 3 and Cesium JS. Create the map with OpenLayers 3 and visualise it on a globe using Cesium.

Features:
---------
Switch smoothly between 2D and 3D and synchronise:
- Map context (bounding box and zoom level);
- Raster data sources;
- Vector data sources in 2D and 3D;
- Map seelection (selected items)

Integration library for OpenLayers 3 and Cesium JS. Create the map with OpenLayers 3 and visualise it on a globe using Cesium.

Features:
---------
Switch smoothly between 2D and 3D and synchronise:
- Map context (bounding box and zoom level);
- Raster data sources;
- Vector data sources in 2D and 3D;
- Map seelection (selected items)

**WARNING** This package is large as it contains the unminified versions of OL3 and Cesium. It is intended for use during development. For production deployments use OL3-Cesium package
